// sidebar imports

import {
    UilEstate,
    UilClipboardAlt,
    UilUsersAlt,
    UilPackage,
    UilChart,
    UilSignOutAlt,

} from "@iconscout/react-unicons";

// sidebar data
export const SidebarData = [
    {
        icon: UilEstate,
        heading: "Dashboard",
    },
    {
        icon: UilClipboardAlt,
        heading: "Orders",
    },
    {
        icon: UilUsersAlt,
        heading: "Customers",
    },
    {
        icon: UilPackage,
        heading: "Products",
    },
    {
        icon: UilChart,
        heading: "Analtics",
    },
];

export const CardsData = [
    {
        title: "Sales",
        color: {
            background: "linear-gradient(180deg, # bb67ff 0%, # c484f3 100%)",
            boxShadow: "0px 10px 20px 0px # e0c6f5",
        },
        barValue: 70,
        value: "25,970",
        png: UilUsdSquare,
        series: [
            {
                name: "sales",
                data: [31,30,28, 51, 42, 109,100],
            },
        ],

    },
    {
        title: "Revenue",
        color: {
            background: "linear-gradient(180deg, #FF919D 0%, #FC929D 100%)",
            boxShadow: "0px 10px 20px 0px # e0c6f5",
        },
        barValue: 80,
        value: "25,970",
        png: UilUsdSquare,
        series: [
            {
                name: "Recenue",
                data: [31,30,28, 51, 42, 109,100],
            },
        ],

    },
]
